package com.xmy.quotamanage.entity;import java.util.Date;/** * @author xmy * @date 2021/4/16 1:11 下午 */public class User {    private Long id;    private String nickname;    private String password;    private Long quotaId;    public User() {    }    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getNickname() {        return nickname;    }    public void setNickname(String nickname) {        this.nickname = nickname;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public Long getQuotaId() {        return quotaId;    }    public void setQuotaId(Long quotaId) {        this.quotaId = quotaId;    }    @Override    public String toString() {        return "User{" +                "id=" + id +                ", nickname='" + nickname + '\'' +                ", password='" + password + '\'' +                ", quotaId=" + quotaId +                '}';    }}